import {
  BrowserRouter as Router,
  Routes,
  Route
} from 'react-router-dom';
import BlogForm from './components/BlogForm';
import NavBar from './components/NavBar';

function App() {


  return(
    <Router>

      <div className="container">
        <Routes>
          <Route path="/" exact>
            Home page
          </Route>
          <Route path="/blogs" element={ <BlogForm /> } />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
